import React from 'react';

const Dropdown = ({options}) => {
    const renderedOpions = options.map((option) => {
        return (
            <div key={option.value} className="item">
                {option.label}
            </div>
        );
    });
    return (
        {renderedOpions}
    );
}

export default Dropdown;
